import "@aws-amplify/ui-react/styles.css";
//import { callApi } from "callApi.js";
const Mainfunc = () => {
  return (
    <div>
      <h1>REDACTED PAGES REACHED</h1>
      <form
        name="dynamoDBLookupForm"
        class="query_form"
        action=""
        method="GET"
      ></form>
    </div>
  );
};

export default withAuthenticator(Mainfunc);
